import Mathematique from './Mathematique';

export default class MontantAvecTaxes {

    constructor() {
        this._year = null;
        this._montantSansTaxe = 0;
    }
    
    getMontantSansTaxe() {
        return this._montantSansTaxe;
    }

    getTPS() {
        return this._year == null ? 0 : Mathematique.calculTPS(this._year, this._montantSansTaxe);
    }
    
    getTVQ() {
        return this._year == null ? 0 : Mathematique.calculTVQ(this._year, this._montantSansTaxe);
    }

    getMontantAvecTaxe() {
        return this._montantSansTaxe + this.getTPS() + this.getTVQ();
    }

    getYear() {
        return this._year;
    }
}
